	add("intellect", "{\"term\":\"intellect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|intellēctus||understanding, intellect}}, perfect passive participle of {{m|la|intellegō||understand; reason}}, from \u0027inter\u0027 (between, among) + {{m|la|legō||read}}, with connotation of \u0027bind\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the faculty of thinking, judging, abstract reasoning, and conceptual understanding; the cognitive faculty \u0027(uncountable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Intellect\u0027\u0027 is one of man\u0027s greatest powers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the capacity of that faculty (in a particular person) \u0027(uncountable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They were chosen because of their outstanding \u0027\u0027intellect\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a person who has that faculty to a great degre\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Some of the world\u0027s leading \u0027\u0027intellects\u0027\u0027 were meeting there\", \"priority\":6}]}, \"synonyms\":{}}");

	add("intelligence", "{\"term\":\"intelligence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027intelligence\u0027 from Latin \u0027intelligentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Capacity of mind, especially to understand principles, truths, facts or meanings, acquire knowledge, and apply it to practice; the ability to learn and comprehend\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, , Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not so, however, with Tarzan, the man-child. His life amidst the dangers of the jungle had taught him to meet emergencies with self-confidence, and his higher \u0027\u0027intelligence\u0027\u0027 resulted in a quickness of mental action far beyond the powers of the apes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/lifeandstyle/2013/jul/08/irregular-bedtimes-affect-childrens-brains Irregular bedtimes may affect children\u0027s passage\u003dIrregular bedtimes may disrupt healthy brain development in young children, according to a study of \u0027\u0027intelligence\u0027\u0027 and sleeping habits.\u0026amp;nbsp; \u0026amp;para;\u0026amp;nbsp;Going to bed at a different time each night affected girls more than boys, but both fared worse on mental tasks than children who had a set bedtime, researchers found\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An entity that has such capacities\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Tennyso\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The great \u0027\u0027Intelligences\u0027\u0027 fair / That range above our mortal state, / In circle round the blessed gate, / Received and gave him welcome there\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Information, usually secret, about the enemy or about hostile activities\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A political or military department, agency or unit designed to gather information, usually secret, about the enemy or about hostile activities\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Acquaintance; intercourse; familiarity\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Clarendo\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"He lived rather in a fair \u0027\u0027intelligence\u0027\u0027 than any friendship with the favourites\", \"priority\":12}]}, \"synonyms\":{}}");

	add("intempestivity", "{\"term\":\"intempestivity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From the Latin {{m|la|intempestīvitās}}; cognate with the French \u0027intempestivité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Unseasonability; untimeliness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027: Renato Poggioli, \u0027The Phoenix and the Spider: A Book of Essays About Some Russian Writers and Their View of the Self\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003ds4sjAAAAMAAJ\u0026amp;q\u003dintempestivity\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0 page 191]\u0026lt;/span\u0026gt; (Harvard University Press\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This “untimeliness” has nothing to do with the “\u0027\u0027intempestivity\u0027\u0027” of Nietzsche, which implies a denial of the present and an affirmation of future values\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027: Michael Pertwee, \u0027Name Dropping: The Autobiography of Michael Pertwee\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dDoUIAQAAIAAJ\u0026amp;q\u003dintempestivity\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0 page 71]\u0026lt;/span\u0026gt; (Frewin; ISBN 0856320714, 9780856320712\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I do not know if he wrote his own script, but whoever did, his subsequent pep talk was a masterpiece of \u0027\u0027intempestivity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027: Polskie Towarzystwo Socjologiczne, \u0027The Polish Sociological Bulletin\u0027, issues 31–40, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d6g3TAAAAMAAJ\u0026amp;q\u003dintempestivity\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0 page 49]\u0026lt;/span\u0026gt; (self-published\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"… I]n general, there has been insufficient realization of the \u0027\u0027intempestivity\u0027\u0027 of much theoretical debate within the discipline\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027: James Patrick Donleavy, \u0027Schultz\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d7YywAAAAIAAJ\u0026amp;q\u003dintempestivity\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0 page 329]\u0026lt;/span\u0026gt; (Delacorte Press/Seymour Lawrence; ISBN 0440079578, 9780440079576\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“O dear Schultz, here we go again. Same old headline. Sperm Productions, that innocent company dragged yet again into another Schultz \u0027\u0027intempestivity\u0027\u0027. With Gayboy already in a state. Raging that the show is giving the theatre such a bad name that it could ruin business for years to come. And dear me this little news item will promptly blow his hemorrhoids clean out of his backside. Forgive me Rebecca\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027: Heidrun Friese, \u0027The Moment: Time and Rupture in Modern Thought\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dG5NFJ_M3QQIC\u0026amp;pg\u003dPA18\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dintempestivity\u0026amp;f\u003dfalse page 18] ([http://www.liverpool-unipress.co.uk/ Liverpool University Press]\u0026lt;/span\u0026gt;; ISBN 0853239568, 9780853239567\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Any talk about the moment suggests that it really is the right moment to talk about the right moment, that its time has come — and explicit claims to untimeliness or \u0027\u0027intempestivity\u0027\u0027 are, one might suspect, no more than a further twist of this structure\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027: Odorico Monteiro de Andrade, \u0027Management of the Brazilian Health System\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dhU1gAAAAMAAJ\u0026amp;q\u003dintempestivity\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0 page 150]\u0026lt;/span\u0026gt; (CONASEMS; ISBN 8527105950, 9788527105958\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"d) Gradualism.\u0027 The system should avoid certain inherent distortions to the generated processes of centralized structure, such as ritualism, \u0027\u0027intempestivity\u0027\u0027, bureaucracy, imposition of norms, etc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027: David Wills, \u0027Dorsality: Thinking Back Through Technology and Politics\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d_9Z_D5r6d5cC\u0026amp;pg\u003dRA1-PA213\u0026amp;dq\u003dintempestivity\u0026amp;lr\u003d\u0026amp;as_drrb_is\u003dq\u0026amp;as_minm_is\u003d0\u0026amp;as_miny_is\u003d\u0026amp;as_maxm_is\u003d0\u0026amp;as_maxy_is\u003d\u0026amp;num\u003d100\u0026amp;as_brr\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dintempestivity\u0026amp;f\u003dfalse page 213] ([http://www.upress.umn.edu/ University of Minnesota Press]\u0026lt;/span\u0026gt;; ISBN 0816653461, 9780816653461\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Nietzsche seems an obvious guide here. No philosopher in the tradition presents himself as more contrarian, indeed polemical; no one abandons himself more to the perils of what would normally pass for contradiction and illogicality, intemperance and \u0027\u0027\u0027intempestivity\u0027\u0027\u0027 or untimeliness; no one uses declamation so consistently as a strategy against platitude, value as a weapon against morality, irony and sarcasm in the service of rhetorical demystification, interpretation, and affirmation\", \"priority\":17}]}, \"synonyms\":{}}");

