	add("interfix", "{\"term\":\"interfix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|fix|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An empty morph inserted between two morphemes in the process of word formation, such as English\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Francis Katamba, \u0027Morphology: Critical Concepts in Linguistics\u0027 [http://books.google.com/books?id\u003dQBsKpjIh3J8C], ISBN 0415270790, page 187\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An empty morph is an \u0027\u0027interfix\u0027\u0027 if it fulfills all of the following three conditions (Dressier, 1985f\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An association link, a device to group multiple words or concepts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027, Frank S. Wagner, Jr., \u0027A Dictionary of Documentation Terms\u0027 [http://books.google.com/books?id\u003dMlgZAAAAMAAJ], page 19\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"LOCANT, n. A number used in the Dyson cipher system for coding the position of substituents of carbon chain, i.e. an \u0027\u0027interfix\", \"priority\":6}]}, \"synonyms\":{}}");

	add("interframe", "{\"term\":\"interframe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|frame|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A video frame which is compressed to express only the change from a reference fram\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of bolster for a folding knif\", \"priority\":2}]}, \"synonyms\":{}}");

