	add("interjacence", "{\"term\":\"interjacence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being interjacent\", \"priority\":1}]}, \"synonyms\":{}}");

	add("interjacency", "{\"term\":\"interjacency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being interjacent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something that lies between\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"England and Scotland is divided only by the \u0027\u0027interjacency\u0027\u0027 of the Tweed.\u0027 \u0026amp;mdash; Sir M. Hale\", \"priority\":3}]}, \"synonyms\":{}}");

	add("interjection", "{\"term\":\"interjection\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027interjection\u0027 (13c.), from Latin {{m|la|interiectiōnem}}, accusative singular of {{m|la|interiectiō||throwing or placing between; interjection}}, perfect passive participle of {{m|la|intericiō||throw or place between}}, from \u0027inter\u0027 (between) + {{m|la|iaciō||throw}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An exclamation or filled pause; a word or phrase with no particular grammatical relation to a sentence, often an expression of emotion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Some evidence confirming our suspicions that topicalised and dislocated constituents occupy different sentence positions comes from Greenberg (1984). He notes that in colloquial speech the \u0027\u0027interjection\u0027\u0027 \u0027man\u0027 can occur after dislocated constituents, but not after topicalised constituents: cf.\u0026lt;br\u0026gt; (21) (a) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; \u0027Bill\u0027, man, I really hate him (dislocated NP)\u0026lt;br\u0026gt; \u0026lt;font color\u003dwhite\u0026gt;(21)\u0026lt;/font\u0026gt; (b) \u0026amp;nbsp;\u0026amp;nbsp; \u0026lt;sup\u0026gt;\u0026lt;small\u0026gt;✽\u0026lt;/small\u0026gt;\u0026lt;/sup\u0026gt;\u0027Bill\u0027, man, I really hate (topicalised NP\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An interruption; something interjected\", \"priority\":3}]}, \"synonyms\":{}}");

	add("interlace", "{\"term\":\"interlace\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027entrelacen\u0027, from Anglo-norman \u0027entrelacer\u0027, from \u0027entre-\u0027 + \u0027lacer\u0027 (weave)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A technique of improving the picture quality of a video signal primarily on CRT devices without consuming extra bandwidth\", \"priority\":1}]}, \"synonyms\":{}}");

