	add("interloper", "{\"term\":\"interloper\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Dutch\"], \"text\":\"1590s, from {{prefix|inter|loper|t2\u003drunner, rover|lang\u003den}}, as in \u0027landloper\u0027 (vagrant) (from Dutch or \u0027lope\u0027 (to leap, to jump) (originally dialectal). Originally spelt \u0027enterloper\u0027 and used in specific sense “unauthorized trader trespassing on privileges of chartered companies”, later general sense of “self-interested intruder” from 1630s.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unlicensed or illegitimate trader\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who interferes, intrudes or gets involved where not welcome, particularly a self-interested intruder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They disliked the \u0027\u0027interloper\u0027\u0027, and forced him to leave\", \"priority\":3}]}, \"synonyms\":{}}");

	add("interloping", "{\"term\":\"interloping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Noun form of the word \u0026quot;interloper\u0026quot; (see etymology for interloper for more)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of intrusion or encroachment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There was an \u0027\u0027interloping\u0027\u0027 on my property\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Illegal Indian trade within the area over which the held a trade monopoly\", \"priority\":3}]}, \"synonyms\":{}}");

	add("intermarriage", "{\"term\":\"intermarriage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|marriage|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Marriage between people belonging to different groups, such as different racial, ethnic, or religious groups; mixed marriage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"During the 1960s, some Georgians opposed the \u0027\u0027intermarriage\u0027\u0027 of blacks and whites\", \"priority\":2}]}, \"synonyms\":{}}");

