	add("interoperability", "{\"term\":\"interoperability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|interoperable|ity|lang\u003den}}; alternatively analyzed as {{prefix|inter|operability|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The capability of a product or system, to interact and function with others reciprocally\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The capacity for a service, piece of equipment etc., to be operated by different forces or groups\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0026quot;Entente or bust\u0026quot;, \u0027The Economist\u0027, 14 Oct 2010\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dr Fox and Mr Morin have ruled out the notion of binational crews, but they are still exploring other ways to enhance the \u0027\u0027interoperability\u0027\u0027 of France’s \u0027Charles de Gaulle\u0027 and Britain’s planned two new carriers, which seem likely to be spared by the defence review\", \"priority\":4}]}, \"synonyms\":{}}");

