	add("interpellation", "{\"term\":\"interpellation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027interpellation\u0027 from Latin \u0027interpellatio\u0027 Compound of {{suffix|interpellate|tion|lang\u003den}} or {{suffix|interpel|tion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of interpellating (questioning); the period in which government officials are questioned about and explain an act, a policy or a point raised during a debate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of interpellating: the act of identification\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of interpelling: interruption\", \"priority\":3}]}, \"synonyms\":{}}");

	add("interphase", "{\"term\":\"interphase\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|phase|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The stage in the life cycle of a cell between two successive mitotic or meiotic divisions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;!--see Google Books--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

	add("interplea", "{\"term\":\"interplea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|plea|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An action ingrafted on another suit, in which the interpleader becomes the plaintiff and the attaching plaintiff is the defendant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("interpleader", "{\"term\":\"interpleader\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|interplead|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes an interplea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Motion for a third party to enter into a lawsuit in process because a matter is being adjudicated in which they have an interest\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Process by which a third party asks a court to determine which of two rival claims is to be honored by the third party\", \"priority\":3}]}, \"synonyms\":{}}");

