	add("interpretivism", "{\"term\":\"interpretivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|interpretive|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"antipositivis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"qualitative researc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A school of cultural anthropological thought founded by\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A school of thought holding that law is not a set of given data, conventions or physical facts, but what lawyers aim to construct or obtain in their practice\", \"priority\":4}]}, \"synonyms\":{}}");

