	add("interrobang", "{\"term\":\"interrobang\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The symbol (combination of ? and\", \"priority\":1}]}, \"synonyms\":{}}");

	add("interrogation", "{\"term\":\"interrogation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027interrogacion\u0027 from Latin \u0027interrogatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of interrogating or questioning; examination by questions; inquiry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A question put; an inquiry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A point, mark, or sign, thus ?, indicating that the sentence with which it is connected is a question. It is used to express doubt, or to mark a query. Called also interrogation point\", \"priority\":3}]}, \"synonyms\":{}}");

	add("interrogator", "{\"term\":\"interrogator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|interrogate|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who interrogates; a person who asks questions; a questioner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device that requests data from another device\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Mark Beaulieu, \u0027Wireless Internet applications and architecture\u0027 (page 126\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any RFID \u0027\u0027interrogator\u0027\u0027 within 30 meters can read an RFID tag in active mode\", \"priority\":4}]}, \"synonyms\":{}}");

	add("interruption", "{\"term\":\"interruption\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027interrupcion\u0027 from Latin \u0027interruptio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of interrupting, or the state of being interrupted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dOne morning I had been driven to the precarious refuge afforded by the steps of the inn, after rejecting offers from the Celebrity to join him in a variety of amusements. But even here I was not free from \u0027\u0027interruption\u0027\u0027, for he was seated on a horse-block below me, playing with a fox terrier\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d2|page\u003d27|magazine\u003d|title\u003d[http://www.guardian.co.uk/technology/2013/may/10/conscious-computing-twitter-facebook-google The tao of passage\u003dThe dirty secret of the internet is that all this distraction and \u0027\u0027interruption\u0027\u0027 is immensely profitable. Web companies like to boast about \u0026quot;creating compelling content\u0026quot;, or offering services that let you \u0026quot;stay up to date with what your friends are doing\u0026quot;and so on\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A time interval during which there is a cessation of something\", \"priority\":4}]}, \"synonyms\":{}}");

	add("intersection", "{\"term\":\"intersection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027intersection\u0027 from Latin \u0027intersectiō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The junction of two (or more) paths, streets, highways, or other thoroughfares\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The point or set of points common to two geometrical objects (such as the point where two lines meet or the line where two planes intersect\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The set containing all the elements that are common to two or more sets\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The element where two or more straight lines of synchronized synchronized skaters pass through each other.[http://www.isu.org/vsite/vcontent/content/transnews/0,10869,4844-128590-19728-18885-295370-3787-4771-layout160-129898-news-item,00.html\", \"priority\":4}]}, \"synonyms\":{}}");

	add("intersectionalism", "{\"term\":\"intersectionalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|intersectional|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of minorities within minorities, or intersections between minorities; specifically, the study of the interactions of multiple systems of oppression or discrimination\", \"priority\":1}]}, \"synonyms\":{}}");

	add("intersex", "{\"term\":\"intersex\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027intersexe\u0027 corresponding to \u0027inter-\u0027 + \u0027sex\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a variety of conditions (in a dioecious species) whereby an individual has male and female sex characteristics; the state of having the physical features of both sexes; intersexuality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1953\u0027\u0027, \u0027Time\u0027, 23 Feb 1953\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Canadian believes that he has solved the diagnostic problem in human \u0027\u0027intersex\u0027\u0027. All human cells, says Dr. Murray L. Barr of the University of Western Ontario, contain something called sex chromatin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Andrew J Lawrence et al., \u0027Effects of Pollution on Fish\u0027, page 204\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A much more common condition caused by early exposure of fish larvae to oestrogenic substances is \u0027\u0027intersex\u0027\u0027, which in males usually takes the form of ovotestis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Emine Saner, \u0027The Guardian\u0027, 30 Jul 2008, G2, page 12\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It is thought that around one in 1,000 babies are born with an \u0026quot;\u0027\u0027intersex\u0027\u0027\u0026quot; condition, the general term for people with chromosomal abnormalities\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An individual with any of these conditions\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Mary C Smith \u0026amp; David Sherman, \u0027Goat Medicine\u0027, page 609\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An \u0027\u0027intersex\u0027\u0027, then, is an animal that shows both male and female characteristics\", \"priority\":10}]}, \"synonyms\":{}}");

	add("intersphere", "{\"term\":\"intersphere\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|sphere|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sphere that is tangent to every edge of a given polyhedron\", \"priority\":1}]}, \"synonyms\":{}}");

	add("interstacking", "{\"term\":\"interstacking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|stacking|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Stacking together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958\u0027\u0027, Milk Industry Foundation (U.S.), \u0027Convention Proceedings\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"manufacturers of milk bottle cases have adopted the standards contained in the Simplified Practice Recommendation so that little, if any, difficulty is encountered in the \u0027\u0027interstacking\u0027\u0027 of cases made by the different manufacturers\", \"priority\":3}]}, \"synonyms\":{}}");

	add("interstice", "{\"term\":\"interstice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027interstice\u0027 from Latin \u0027interstitium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small opening or space between objects, especially adjacent objects or objects set closely together, as between cords in a rope or components of a multiconductor electrical cable or between atoms in a crystal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fragment of space\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d14 August passage\u003dRelics of the British empire now mostly survive in the \u0027\u0027interstices\u0027\u0027 of the global economy. They are the major winners from the fiscal haemorrhage that has resulted from financial globalisation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An interval of time required by the Roman Catholic Church between the attainment of different degrees of an order\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"by extension\u0027) A small interval of time free to be spent on activities other than one\u0027s primary goal\", \"priority\":5}]}, \"synonyms\":{}}");

	add("interstitium", "{\"term\":\"interstitium\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027interstitium\u0027 () from \u0027inter\u0027 (between) + \u0027sistere\u0027 (to stand, place)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An interstitial space within a tissue or organ\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Specifically the tissue between the pulmonary alveoli and the bloodstream\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A state between systems or spaces\", \"priority\":3}]}, \"synonyms\":{}}");

	add("intertext", "{\"term\":\"intertext\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|inter|text|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reference to one text within another\", \"priority\":1}]}, \"synonyms\":{}}");

