	add("intervacuum", "{\"term\":\"intervacuum\", \"etymology\":{\"influencers\":[], \"languages\":[\"Latin\"], \"text\":\"Formed as {{prefix|inter|vacuum|lang\u003den}}, but compare the Latin {{m|la|intervacō||I am empty between}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An empty ; a\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1827\u0027\u0027 April, w:Samuel Taylor Samuel Taylor Coleridge [aut.], and w:Kathleen Kathleen Coburn and Anthony John Harding [eds.], \u0027The Notebooks of Samuel Taylor Coleridge\u0027, volume V: “1827–1834”, part 1: ‘Text’, (2002, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://press.princeton.edu/titles/7373.html Princeton University Press], ISBN 0691099073), [http://books.google.co.uk/books?id\u003dahlDCL827p0C\u0026amp;pg\u003dPA34\u0026amp;dq\u003d%22intervacua%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddvJiT_eBBcO-8APCkrTnBw\u0026amp;ved\u003d0CD0Q6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22intervacua%22\u0026amp;f\u003dfalse entry 5504: \u0027ff11ᵛ–12\u0027]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In the distribution of the Animals themselves, the Subjects and the products of this energy, into the principal Classes, we do not suppose chasms \u0026amp; \u0027\u0027intervacua\u0027\u0027 or empty Interspaces between the Classes, but ascend from a lower to a higher by an interliminary — and the same principle holds good in the \u0027Dynamics\u0027 of Organic Nature, and the Enumeration and the Order of the three Constitutive Forms of the Vital Energy\", \"priority\":4}]}, \"synonyms\":{}}");

	add("interval", "{\"term\":\"interval\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 lt;!-- Old French not in Century 1911--\u0026gt;, from Latin \u0027lang\u003dla|intervallum\u0027 () from \u0027lang\u003dla|inter\u0027 () + \u0027lang\u003dla|vallum\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A distance in space\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Twixt host and host but narrow space was left, / A dreadful \u0027\u0027interval\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A period of time\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027interval\u0027\u0027 between contractions during childbirth\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The difference (a ratio or logarithmic measure) in pitch between two notes, often referring to those two pitches themselves (otherwise known as a dyad\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A connected section of the real line which may be empty or have a length of zero\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An intermission\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"half time, a scheduled intermission between the periods of pla\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Either of the two breaks, at lunch and tea, between the three sessions of a day\u0027s play\", \"priority\":10}]}, \"synonyms\":{}}");

	add("interviewer", "{\"term\":\"interviewer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027interview\u0027 + \u0027-er\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who interviews\", \"priority\":1}]}, \"synonyms\":{}}");

