	add("intimation", "{\"term\":\"intimation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027intimation\u0027 from Latin \u0027intimatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of intimating; also, the thing intimated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Announcement; declaration\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They made an edict with an \u0027intimation\u0027 that whosoever killed a stork, should be banished\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A hint; an obscure or indirect suggestion or notice; a remote or ambiguous reference; as, he had given only intimations of his design\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Without mentioning the king of England, or giving the least \u0027\u0027intimation\u0027\u0027 that he was sent by him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1862\u0027\u0027, Walking\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"At length, perchance, the immaterial heaven will appear as much higher to the American mind, and the \u0027\u0027intimations\u0027\u0027 that star it as much brighter\", \"priority\":7}]}, \"synonyms\":{}}");

	add("intimidation", "{\"term\":\"intimidation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027intimidation\u0027 from as if *\u0027\u0027 () from \u0027intimidare\u0027 () see intimidate.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of making timid or fearful or of deterring by threats; the state of being intimidated; as, the voters were kept from the polls by intimidation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("intolerableness", "{\"term\":\"intolerableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|intolerable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being intolerable or insufferable\", \"priority\":1}]}, \"synonyms\":{}}");

