	add("intonation", "{\"term\":\"intonation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027intonation\u0027 from \u0027intonatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rise and fall of the voice in speaking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of sounding the tones of the musical scale\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Singing or playing in good tune or otherwise\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Her \u0027\u0027intonation\u0027\u0027 was false\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Reciting in a musical prolonged tone; intonating or singing of the opening phrase of a plain-chant, psalm, or canticle by a single voice, as of a priest\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A thundering; thunder\", \"priority\":6}]}, \"synonyms\":{}}");

	add("intoxication", "{\"term\":\"intoxication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|intoxiquer|tion|lang\u003dfr}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A poisoning, as by a spirituous or a narcotic substance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He suffered acute \u0027\u0027intoxication\u0027\u0027 from the combined effects of several drugs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The state of being intoxicated or drunk; inebriation; ebriety; drunkenness; the act of intoxicating or making drunk\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A high excitement of mind; an elation which rises to enthusiasm, frenzy, or madness\", \"priority\":4}]}, \"synonyms\":{}}");

