	add("intrada", "{\"term\":\"intrada\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a piece of music which serves as an introductio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We listened to Telemann\u0027s \u0027\u0027intrada\u0027\u0027 for two flutes\", \"priority\":2}]}, \"synonyms\":{}}");

	add("intraframe", "{\"term\":\"intraframe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|intra|frame|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A video frame which does not depend on any other frame for rendering, but simply presents fixed image. Usually subject to spatial compression\", \"priority\":1}]}, \"synonyms\":{}}");

	add("intrepidity", "{\"term\":\"intrepidity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|intrepid|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being intrepid; bravery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1877\u0027\u0027, w:Henry Henry James, \u0027w:The American The American\u0027, page 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"which involve the sharpest hazards to life and honour and the highest instant decisions and \u0027\u0027intrepidities\u0027\u0027 of action\", \"priority\":3}]}, \"synonyms\":{}}");

