	add("introducer", "{\"term\":\"introducer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|introduce|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone or something that introduces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1850\u0027\u0027, \u0027The Cottager\u0027s Monthly Visitor\u0027 (volume 30, page 314\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The impartial observer of mankind is compelled to acknowledge that anger is the bane of society, the \u0027\u0027introducer\u0027\u0027 of discord into the families of rich and poor, the disjoiner of friendships, the destroyer of conjugal and domestic bliss\", \"priority\":3}]}, \"synonyms\":{}}");

	add("introduction", "{\"term\":\"introduction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027introduction\u0027 from Latin (ultimately {{m|la|intrōdūcō}}), ultimately from Proto-indo-european {{m|ine-pro|*h₁énteros||inner, what is inside}} and Proto-indo-european {{m|ine-pro|*dewk-}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of introducing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A means, such as a personal letter, of presenting one person to another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An initial section of a book or article, which introduces the subject material\", \"priority\":3}]}, \"synonyms\":{}}");

