	add("introitus", "{\"term\":\"introitus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027introitus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The entrance to a hollow organ or canal; often specifically the entrance to the vagina\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027: Thomas Alexander Stamey, \u0027Pathogenesis and Treatment of Urinary Tract Infections\u0027, [http://books.google.co.uk/books?id\u003d6SVsAAAAMAAJ\u0026amp;q\u003d%22their+introitus%22\u0026amp;dq\u003d%22their+introitus%22\u0026amp;lr\u003d\u0026amp;ei\u003dbys1Sr7XNJiCyAS404mfBg\u0026amp;pgis\u003d1 page 144] (Williams \u0026amp; Wilkins; ISBN 0683079093, 9780683079098\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"During NA therapy, 49 of the 54 women cleared their \u0027\u0027introitus\u0027\u0027 of all Enterobacteriaceae\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027: Daniel Carleton Gajdusek, \u0027Melanesian journal: expedition to New Hebrides, Solomon Islands, Manus, New Britain, and New Guinea, 23 January 1965 to 7 April 1965\u0027, [http://books.google.co.uk/books?id\u003dQHRqAAAAMAAJ\u0026amp;q\u003d%22their+introitus%22\u0026amp;dq\u003d%22their+introitus%22\u0026amp;lr\u003d\u0026amp;ei\u003dbys1Sr7XNJiCyAS404mfBg\u0026amp;pgis\u003d1 page 90] (Study of Child Growth and Development and Disease Patterns in Primitive Cultures, Laboratory of Central Nervous System Studies, National Institute of Neurological Disease and Stroke, National Institutes of Health\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is nothing feminine about these male pseudohermaphrodites except their introitus, and they seem to be normally male otherwise\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A piece of music played before a mass; a musical introduction of any sort\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027: Gustave Reese, \u0027Music in the Renaissance\u0027, [http://books.google.co.uk/books?id\u003d7E44AAAAMAAJ\u0026amp;dq\u003d%22these+introitus%22\u0026amp;lr\u003d\u0026amp;ei\u003dKS41SsriMJbozASJwbWICQ page 22] (W.W. Norton\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Five have an \u0027\u0027introitus\u0027\u0027 (introduction) that stands outside the isorhythmic scheme;\u0026lt;sup\u0026gt;108\u0026lt;/sup\u0026gt; some of these \u0027\u0027introitus\u0027\u0027 are instrumental rather than vocal […\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027: Jon Michael Allsen, \u0027Style and intertextuality in the isorhythmic motet 1400–1440\u0027, volume 1, [http://books.google.co.uk/books?id\u003dfsxrAAAAMAAJ\u0026amp;q\u003d%22these+introitus%22\u0026amp;dq\u003d%22these+introitus%22\u0026amp;lr\u003d\u0026amp;ei\u003dKS41SsriMJbozASJwbWICQ\u0026amp;pgis\u003d1 page 118] (University of Wisconsin–Madison\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"As summarized in Example 3.14, nearly all of these \u0027\u0027introitus\u0027\u0027 […\", \"priority\":10}]}, \"synonyms\":{}}");

