	add("intromission", "{\"term\":\"intromission\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027intro-\u0027\u0027, \u0026quot;into\u0026quot;, + \u0027\u0027mission\u0027\u0027, \u0026quot;sending\u0026quot;, from Latin \u0027missio\u0027, from perfect passive participle \u0027missus\u0027, \u0026quot;sent\u0026quot;, from verb \u0027mittere\u0027, \u0026quot;send\u0026quot;, + noun of action \u0027-io\u0027. Commonly used to refer to the instant at which sexual intercourse begins, when the penis first slides into (enters) the vagina.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state of being allowed to enter; admittanc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the act of allowing to enter; admissio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"putting one thing into another; insertio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, w:Henry Henry James, \u0027The Reverberator\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Your father has told me all about it. Did you ever hear of anything so ridiculous?\u0026quot;\u0026lt;br\u0026gt;\u0026quot;All about what?—all about what?\u0026quot; said Delia, whose attempt to represent happy ignorance seemed likely to be spoiled by an \u0027\u0027intromission\u0027\u0027 of ferocity. She might succeed in appearing ignorant, but she could scarcely succeed in appearing happy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"copulation: normally refers to the first moment of initial entry of a penis into a vagina, mouth or anus\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An intermeddling with the affairs of another, either on legal grounds or without authority\", \"priority\":7}]}, \"synonyms\":{}}");

